    pts = JSON.parse(pts);
    var nbPts = pts.length;
    var tiles = [];
    for(var i = 0; i <= nbPts-1; i++){
        var s = pts[i];
        var e = (i == nbPts-1 ? pts[0] : pts[i+1]);
        var addTiles= Geometry.addCorners(Geometry.straightLine(s,e));
        if(i > 0) addTiles.shift();
        tiles = tiles.concat(addTiles);
    }
    for(var i = tiles.length-2; i >= 0; i--){
        var t = tiles[i];
        for(var j = 1; j < 5; j++){ // knots & duplicates
            if(i+j > tiles.length-1) continue;
            var old= tiles[i+j];
            if(t.x == old.x && t.y == old.y){
                //console.log('knot of size '+j+' at '+ t.x+', '+ t.y);
                tiles.splice(i+1,j); // remove j points corresponding to size of knot
            }
        }
    }

    for(var i = 0; i < tiles.length-1; i++){
        var t = tiles[i];
        var next = tiles[i+1];
        var dx = next.x - t.x;
        var dy = next.y - t.y;
        if(dx == 1 && dy == 1){ // angle bottom-right
            tiles.splice(i+1,0,{
                x: t.x,
                y: t.y+1
            });
            i++;
        }
        if(dx == 1 && dy == -1){
            tiles.splice(i+1,0,{
                x: t.x+1,
                y: t.y
            });
            i++;
        }
        /*if(dx == -1 && dy == 1){
            console.log('angle at '+ t.x+', '+ t.y);
        }*/
    }

    tiles = tiles.map(function(t){
            //console.log(t);
            return {x: t.x*32,y: t.y*32};
    });
    Engine.drawHull(tiles);
